import { StyleCardTask } from "./styles";

const CardTask = ({ item }) => {
  return (
    <div>
      <StyleCardTask>
        <span>{item.title}</span>
        <span>{item.category}</span>
        <span>{item.difficulty}</span>
        <span>{item.frequency}</span>
      </StyleCardTask>
    </div>
  );
};

export default CardTask;
